import React, { Component } from "react";

class Home extends Component {
  state = {};
  render() {
    return (
      <div className="section center-both-ways">
        <p className="home-msg">Hi, I'm Michael !</p>
        <p>I am currently seeking summer 2021 internship.</p>
      </div>
    );
  }
}

export default Home;
